                    <div>
                        <label htmlFor="brandName">Brand Name</label>
                        <input type="brandName" name="brandName" id="brandName" />
                        <button>Save</button>
                    </div>
                </form>
            </div>
        )
    }
}
export default connect()(KnifeModal);
